import {useNavigate} from 'react-router-dom'
import logo from '../pics/logo192.png'
import GetWeather from '../weather'

const HtIntro = () =>{
    const text = 'Hometown Introduction:\nMy hometown is located in Inner Mongolian Autonomous Region, which is a north province in China. There are four seasons: spring, hot summer, fall, and cold winter. In my hometown, there are some famous grasslands, for example: Hulunbeir Grassland, Horqin Grassland, ect. In summer, you can enjoy stunning scenery on the grassland and and the local herdsmen are very enthusiastic. While during winter you will see snow, in case of long and cold winter, people are used to store lots of vegetables, like potatos and Chinese cabbages.\n'
    const Navigate = useNavigate()
    const My = () =>{
        Navigate('/')
    }
    return <div>
        {text}
        <img src={logo} alt="logo"/> 
        <button onClick={My}>my introduction</button>
        <GetWeather/>
        </div>
}
export default HtIntro;
